      & div:nth-child(9) {
        .angular-editor-button {
          &:nth-child(2),
          &:nth-child(4) {
            position: relative;
            & > span {
              display: none;
            }
          }

          &:nth-child(2)::before {
            content: 'A';
            text-decoration: underline;
          } 

          &:nth-child(4):before {
            content: 'A';
            position: absolute;
            top: 0;
            left: 0;

            background-color: var(--asimetric-bg-color);
            line-height: 28px;
            width: 32px;
            height: 28px;
            border-radius: 3px;
          } 
        }
      }
    }

    angular-editor-toolbar > div > div:nth-child(7) > ae-select {
      width: 170px!important;
    }

    angular-editor-toolbar > div > div:nth-child(6) > ae-select {
      width: 120px!important;
    }

    .ae-picker {
      display: block;
      height: 100%;

      &-label {
        border-radius: 3px;
        background: var(--asimetric-bg-color)!important;
        color: var(--secondary-color)!important;
        font-size: 14px!important;

        &::before {
          background: var(--asimetric-bg-color)!important;
        }
      }

      &-options {
        background: var(--asimetric-bg-color)!important;
        border-radius: 3px;
        border: none!important;
      }

      &-item {
        color: var(--secondary-color)!important;
        font-size: 14px!important;

        &:hover {
          background-color: var(--light-highlited-gray-color)!important;
        }

        &.selected.focused {
          background-color: var(--light-gray-color)!important;
          color: var(--secondary-color)!important;
        }
      }
    }

    .angular-editor-toolbar {
      display: flex;
      flex-wrap: wrap;
      background: var(--status-bar-bg-color);
      border: 1px solid var(--light-gray2-color);
      border-radius: 12px 12px 0px 0px;
      padding: 13px 37px 7px 42px!important;

      &-set {
        display: contents!important;
      }
    }

    angular-editor-toolbar > div > div:nth-child(1) > button:nth-child(1),
    angular-editor-toolbar > div > div:nth-child(1) > button:nth-child(2),
    angular-editor-toolbar > div > div:nth-child(1) {
      margin-right: 0!important;
      display: none;
    }

    .angular-editor-textarea {
      background: var(--text-color);
      border: 1px solid var(--secondary-color);
      border-top: none!important;
      border-radius: 0px 0px 12px 12px;
      padding: 17px!important;
      margin-top: 0!important;
      outline: none!important;
      white-space: pre-wrap;

      font-family: 'Sofia pro', 'open-sans';
      font-style: normal;
      font-weight: 300;
      font-size: 16px;
      line-height: 28px;
    }

    ae-select > span > button > svg > polygon {
      stroke: var(--secondary-color)!important;
    }

    .ng-pristine {
      margin: 0 5px 5px 0;
    }
  }
}

@media screen and (max-width: 800px) {
  .app-text-editor {
    ::ng-deep {
      .angular-editor-toolbar {
        padding: 8px 15px 3px 15px!important;
      }
    }
  }
}

